import React, { Component } from 'react';
import back from './assets/back.png'

class App extends Component {
  render() {
    return (
      <div className="App">
      <div className="w-100 pl3 staatliches f-subheadline flex justify-center">
        <h1 className="mb0 mt0">
          Daniel Douangkesone
        </h1>
      </div>
      <div className="w-50 pl3 fr">
          Hi, I'm Dan. Nice to meet you.
          Since beginning my journey as a developer nearly 3 years ago, I've graduated
          from General Assembly, and have found my way into engineering. I'm quietly
          confident, curious, and constantly improving my skills.
      </div>
        <div className="w-50">
          <div className="absolute bottom-0">
            <img alt="profile" className="w-50" src={back} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
